import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';
import AddCustomer from './components/AddCustomer';
import AllCustomers from './components/AllCustomers'
import { Col, Container, Row } from 'reactstrap';
import MenuBar from './components/MenuBar';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';



function App() {
  return (
    <div>
      <Router>

        <Header />
        <Container>
          <Row>
            <Col md={4}>  <MenuBar />  </Col>
            <Col md={8}> 
            <Routes>
              <Route path="/" element={<Home/>} exact />
              <Route path="/addcustomer" element={<AddCustomer />} exact />
              <Route path="/viewcustomers" element={<AllCustomers/>} exact />

              <Route path="/addproperty" element={<AddCustomer />} exact />
              <Route path="/viewproperties" element={<AllCustomers/>} exact />

              <Route path="/addbooking" element={<AddCustomer />} exact />
              <Route path="/viewbookings" element={<AllCustomers/>} exact />

              <Route path="/addpayment" element={<AddCustomer />} exact />
              <Route path="/viewpayments" element={<AllCustomers/>} exact />
              </Routes>
            </Col>
          </Row>
        </Container>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
